static InetSocketAddress parseEntry(final String fn, final String hostName,
    final int port) {
  InetSocketAddress addr = new InetSocketAddress(hostName, port);
  if (addr.isUnresolved()) {
    LOG.warn("Failed to resolve {} in {}. ", hostName, fn);
    return null;
  }
  return addr;
}
